import base64

def hamming_distance(a, b):
    return sum(x != y for x, y in zip(a, b))

def binary_to_file(binary_array, output_path):
    byte_data = bytearray()
    for i in range(0, len(binary_array), 8):
        byte = 0
        for bit in binary_array[i:i+8]:
            byte = (byte << 1) | bit
        byte_data.append(byte)
    with open(output_path, 'wb') as f:
        f.write(byte_data)

keys = ''
data = ''
radius = 230
chunk_size = 512

files = {
    'test_text2bin.txt': {
        'chunk_keys': ['', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', ''],
        'original_length': 13560
    },
    'test_text2bin2.txt': {
        'chunk_keys': ['', '', '', '', '', '', '', '', '', ''],
        'original_length': 5040
    },
}

class SDM:
    def __init__(self, keys, data, radius):
        self.keys = keys            # list of key vectors
        self.data = data            # list of lists of vote counts
        self.radius = radius

    def lookup(self, key_vector):
        retrieved_data = [0] * len(key_vector)
        for i, key in enumerate(self.keys):
            hdist = hamming_distance(key, key_vector)
            if hdist <= self.radius:
                for j, val in enumerate(self.data[i]):
                    retrieved_data[j] += val
        return [1 if x > 0 else 0 for x in retrieved_data]

def run_length_decode_packed(encoded):
    decoded = []
    if len(encoded) % 2 != 0:
        raise ValueError("Encoded RLE data should have an even number of elements (count, value pairs).")
    for i in range(0, len(encoded), 2):
        count, val = encoded[i], encoded[i+1]
        if not (0 <= val <= 1):
            raise ValueError(f"Invalid value in RLE data: {val}. Expected 0 or 1.")
        decoded.extend([val] * count)
    return decoded

def load_keys(encoded_keys):
    keys_bytes = base64.b64decode(encoded_keys)
    keys_list = list(keys_bytes)
    decoded_bits = run_length_decode_packed(keys_list)
    # Split into individual key vectors
    keys = [decoded_bits[i:i+chunk_size] for i in range(0, len(decoded_bits), chunk_size)]
    return keys

def load_data(encoded_data):
    data_bytes = base64.b64decode(encoded_data)
    data_list = list(data_bytes)
    # Convert unsigned bytes back to signed integers
    decoded_data = [byte - 256 if byte > 127 else byte for byte in data_list]
    # Split into individual data vectors
    data = [decoded_data[i:i+chunk_size] for i in range(0, len(decoded_data), chunk_size)]
    return data

def reconstruct_file(sdm, chunk_keys, original_length, chunk_size, output_file_name):
    binary_data = []
    for encoded_ck in chunk_keys:
        # Decode Base64 chunk key
        decoded_ck_bytes = base64.b64decode(encoded_ck)
        ck_list = list(decoded_ck_bytes)
        # Decode RLE to get key_vector
        key_vector = run_length_decode_packed(ck_list)
        # Perform lookup to get chunk_data
        reconstructed = sdm.lookup(key_vector)
        binary_data.extend(reconstructed)
    # Trim to original file length
    binary_data = binary_data[:original_length]
    # Write to output file
    binary_to_file(binary_data, output_file_name)

if __name__ == '__main__':
    # Load and decode SDM keys
    sdm_keys = load_keys(keys)
    # Load and decode SDM data
    sdm_data = load_data(data)
    # Initialize SDM with keys, data, and radius
    sdm = SDM(sdm_keys, sdm_data, radius)

    # List available files
    file_names = list(files.keys())
    if not file_names:
        print("No files available for reconstruction.")
        exit()

    print("Available files for reconstruction:")
    for idx, name in enumerate(file_names, 1):
        print(f"{idx}. {name}")

    # Prompt user to select a file
    while True:
        try:
            choice = int(input("Enter the number of the file to reconstruct: "))
            if 1 <= choice <= len(file_names):
                selected_file = file_names[choice - 1]
                break
            else:
                print("Invalid choice. Please enter a valid number.")
        except ValueError:
            print("Invalid input. Please enter a number.")

    # Get file info
    file_info = files[selected_file]
    chunk_keys = file_info['chunk_keys']
    original_length = file_info['original_length']

    # Reconstruct the file
    reconstruct_file(sdm, chunk_keys, original_length, chunk_size, f"reconstructed_{selected_file}")
    print(f"File '{selected_file}' has been reconstructed as 'reconstructed_{selected_file}'.")
